import React, { Component } from 'react';
import './App.css';
import User from './User/User';


class App extends Component {

  number = 2;

  render() {
    return (
      <div className="App">
        <p>This is the app Component</p>
        <SubComponent sentNumber={this.number}></SubComponent>
      </div>
    );
  }
}

export default App;
